import React from 'react';
import { GoogleLogin } from 'react-google-login';
import google from '../../images/icons/google.png';
import facebook from '../../images/icons/facebook.png';

const SocialButtons = () => {
    const responseGoogle = (response) => {
        console.log(response);
    }

    const btnStyle = {
        marginTop: "20px"
    };

    return (
        <React.Fragment>
            <div className="row" style={btnStyle}>
                <div className="col-md-6 form-group">
                    <GoogleLogin
                        clientId="745698499066-u93imtbpjhpbkae60csttbfkmkbqpked.apps.googleusercontent.com"
                        buttonText="Continue with Google"
                        onSuccess={responseGoogle}
                        onFailure={responseGoogle}
                        uxMode='redirect'
                        cookiePolicy={'single_host_origin'}
                    />
                </div>
                <div className="col-md-6 form-group">
                    <button type="button" className="btn btn-light d-flex align-items-center">
                        <img src={facebook} alt="facebook" width="30" height="30" className='mr-2' />
                        Continue with Facebook
                    </button>
                </div>
                <div className="col-md-6 form-group">
                    <button type="button" className="btn btn-light d-flex align-items-center">
                        <img src={google} alt="google" width="30" height="30" className="mr-2" />
                        Continue with Twitter
                    </button>
                </div>
                <div className="col-md-6 form-group">
                    <button type="button" className="btn btn-light d-flex align-items-center">
                        <img src={facebook} alt="facebook" width="30" height="30" className='mr-2' />
                        Continue with Instagram
                    </button>
                </div>
            </div>
        </React.Fragment>
    );
}

export default SocialButtons;
